const Player = (props) => {
  return (
    <div className="col-md-6 col-lg-4 col-xl-3 mt-3">
      <div className="card">
        <div className="card-body">
          <h5 className="card-title">{props.Player.id}</h5>
        </div>
      </div>
    </div>
  );
};

export default Player;

